import BannerHead from "../img/banner_img.png";

let state;
state = {
    arrHead: [
        {
            text: "we conceptualize design and develop apps  that people love",
            img: BannerHead
        }
    ],
    homeBlock2: [
        {
            h1: 'what we do',
            h2: 'we love',
            link: 'sparkle appz',
            text: ' values their customers and strives to deliver software applications for them. These solutions help enterprises and clients increase productivity and facilitate workflow management. We focus to deliver our expertise to our clients within time and make sure that our solutions be aesthetic, technically functional, user-friendly and responsive.'
        }
    ]
};
export default state;
